INSERT INTO `product_version` VALUES ('carControlSystem', 'ubuntu', '10', '2021-04-10 14:07:12', 'T', '增加2020年年度基数调整。\n汇缴补缴支付业务，增加付款账号信息后台获取按钮“▽”，若单位成功办理过网上汇缴或补缴业务，点击该按钮，可以获取到最近一笔成功业务的付款账号信息。', 'http://59.110.230.151:8080/server/projectFile/CAR20210410140711.sql', null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO `product_version` VALUES ('carControlSystem', 'ubuntu', '11', '2021-04-10 14:07:34', 'T', '单位可在线办理“单位缴存网点变更”业务。\n汇缴补缴支付，付款账号编辑界面，增加签约详细流程查看链接。\n“系统帮助” 菜单栏中增加“业务指南”链接。。', 'http://59.110.230.151:8080/server/projectFile/CAR20210410140734.html', null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO `product_version` VALUES ('carControlSystem', 'ubuntu', '12', '2021-04-10 14:08:11', 'T', '调整了汇缴书数据生成规则。\n直联汇补缴支付功能中，补缴业务批量操作人数调整至150人。\n汇补缴签约银行列表更新。', 'http://59.110.230.151:8080/server/projectFile/CAR20210410140810.jpg', null, null, null, null, null, null, null, null, null, null, null);
